import styled from "styled-components";

export const OverviewContainer = styled.div`
  display: flex;
  height: 400px;
  flex-direction: column;
  border-radius: 5px;
  background: #096192;
  margin: 50px 20px 10px 20px;
  box-shadow: rgba(0, 0, 0, 0.05) 0px 1px 2px 0px;
`;
